import { IconButton } from "@mui/material";
import { SidebarBg, SidebarContainer, SidebarHeader, SidebarTitle } from "../../styles/dashboard/DashboardSidebar";
import ShoppingBagIcon from '@mui/icons-material/ShoppingBag';


export default function DashboardSidebar(){
    return(
        <SidebarContainer>          
            <SidebarBg></SidebarBg>
            <SidebarHeader>
                <IconButton><ShoppingBagIcon /></IconButton>
                <SidebarTitle variant="h4">KK Clothing</SidebarTitle>
            </SidebarHeader>
        </SidebarContainer>
    )
}
